                <p>"Usvamos HubSpot h 2 anos, mas o custo estava insustentvel e precisvamos de WhatsApp integrado. Com Funnels, implementamos um funil de nutrio agressivo com sequncias de email + WhatsApp que triplicou nosso volume de reunies agendadas."</p>
